import React from "react"
import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/chat">
            <h1> I'm chat </h1>
          </Route>
          <Route path="/">
            <h1> I'm homepage </h1>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
/*Tinder Cards*/
/*Buttons below Cards*/
export default App;
